import React from 'react'
import Header from '../components/header'
import Search from '../components/search'
import Item from '../components/item'
class Home extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <Search />
        <Item />
        <Item />
        <Item />
        <Item />
        <Item />
      </div>
    )
  }
}

export default Home
